The Builder pattern is very common in Rust when it comes to constructing complex objects like configurations. A configuration builder type should: have a name suffixed by ConfigBuilder; derive the following traits; Default to easily implement the new method as convention; Deserialize, from serde, to deserialize from a configuration file; provide a new method; have Option fields; if there is a configuration file, the fields should have the same names as the keys; provide setters to set/override the fields; provide a finish method constructing the actual configuration object; have default values defined as const and set with Option::unwrap_or/Option::unwrap_or_else; Here is a small example fitting all these requirements. config.toml [snapshot]
meta_file_path = "./data/snapshot/mainnet.snapshot.meta"
state_file_path = "./data/snapshot/mainnet.snapshot.state" config.rs const DEFAULT_META_FILE_PATH: &str = "./data/snapshot/mainnet.snapshot.meta";
const DEFAULT_STATE_FILE_PATH: &str = "./data/snapshot/mainnet.snapshot.state"; #[derive(Default, Deserialize)]
pub struct SnapshotConfigBuilder { meta_file_path: Option<String>, state_file_path: Option<String>,
} impl SnapshotConfigBuilder { pub fn new() -> Self { Self::default() } pub fn meta_file_path(mut self, meta_file_path: String) -> Self { self.meta_file_path.replace(meta_file_path); self } pub fn state_file_path(mut self, state_file_path: String) -> Self { self.state_file_path.replace(state_file_path); self } pub fn finish(self) -> SnapshotConfig { SnapshotConfig { meta_file_path: self.meta_file_path.unwrap_or(DEFAULT_META_FILE_PATH.to_string()), state_file_path: self.state_file_path.unwrap_or(DEFAULT_STATE_FILE_PATH.to_string()), } }
}

