A configuration type should: have a name suffixed by Config; derive the following traits; Clone, since all configuration are most probably aggregated in a common configuration after reading from a file, this trait is needed to give components a unique ownership of their own configuration; Serialize if the configuration is expected to be updated and saved; provide a build method that returns a new instance of the associated builder; have the same fields with the same names, without Option, as the builder; have no public fields; provide setters/updaters only on fields that are expected to be updatable; have getters or pub(crate) fields; Here is a small example fitting all these requirements: config.toml [snapshot]
meta_file_path = "./data/snapshot/mainnet.snapshot.meta"
state_file_path = "./data/snapshot/mainnet.snapshot.state" config.rs #[derive(Clone)]
pub struct SnapshotConfig { meta_file_path: String, state_file_path: String,
} impl SnapshotConfig { pub fn build() -> SnapshotConfigBuilder { SnapshotConfig::new() } pub fn meta_file_path(&self) -> &String { &self.meta_file_path } pub fn state_file_path(&self) -> &String { &self.state_file_path }
}

